import React from 'react';
import { StylesProvider } from '@material-ui/styles'
import { CssBaseLine } from '@material-ui/core'
import GlobalStyle from './components/styles/global-style'

function App() {
  return (
    <div className="App">
      <StylesProvider injectFirst>
        <CssBaseLine>
          <GlobalStyle>
          <div>
            tete
          </div>
          </GlobalStyle>
        </CssBaseLine>
      </StylesProvider>
    </div>
  );
}

export default App;
